        if platform.system() == "Windows":
            subprocess.Popen(["explorer.exe", log_path.replace("/", "\\")])
        elif platform.system() == "Darwin":
            subprocess.Popen(["open", log_path])
        else:
            subprocess.Popen(["xdg-open", log_path])

